<body>
    <div class="login-container">
        <h1>STUPOO</h1>
        <form onsubmit="return validatePassword()">
            <input type="password" id="password" placeholder="Enter Password" required><br>
            <button type="submit">Login</button>
        </form>
    </div>

    <script>
        function validatePassword() {
            const password = document.getElementById('password').value;
            if (password === 'student') {
                window.location.href = 'student_selection.html'; // Redirect to student semester/subject selection
            } else if (password === 'teacher') {
                window.location.href = 'teacher_selection.html'; // Redirect to teacher semester/subject selection
            } else {
                alert('Invalid password');
            }
            return false;
        }
    </script>
</body>
</html>
